import {React, Component} from 'react';
import Image from 'react-bootstrap/Image'

class Results extends Component {
	
	render(){
		return(
			<div>{this.props.data.map((business) => {
				return (
				  <li key={business.id} className='list'>
					<label>{business.name}</label><br></br>
					<label>{business.location.address1}</label><br></br>
					<Image src={business.image_url} thumbnail />
				  </li>
				);
			})}
			</div>
		)
	}
	
}

export default Results;
